import { EventEmitter, Component, Output } from '@angular/core';

@Component({
  selector: 'app-login-form',
  templateUrl: './login-form.component.html',
  styleUrls: ['./login-form.component.css'],
})
export class LoginFormComponent {

  @Output() onSubmitLoginEvent = new EventEmitter();
  @Output() onSubmitRegisterEvent = new EventEmitter();

  active: string = "login";
  firstName: string = "";
  lastName: string = "";
  email: string = "";
  password: string = "";
  phone: string = "";
  city: string = "";
  address: string = "";

  onLoginTab(): void {
    this.active = "login";
  }

  onRegisterTab(): void {
    this.active = "register";
  }

  onSubmitLogin(): void {
    this.onSubmitLoginEvent.emit({
      "email": this.email,
      "password": this.password});
  }

  onSubmitRegister(): void {
    this.onSubmitRegisterEvent.emit({
      "firstName": this.firstName,
      "lastName": this.lastName,
      "email": this.email,
      "password": this.password,
      "phone": this.phone,
      "city": this.city,
      "address": this.address
    });
  }

}
<div class="row justify-content-center">
  <div class="col-4">
    <ul class="nav nav-pills nav-justified mb-3" id="ex1" role="tablist">
      <li class="nav-item" role="presentation">
        <button [ngClass]="active == 'login' ? 'nav-link active' : 'nav-link'" id="tab-login"
                (click)="onLoginTab()" >Bejelentkezés</button>
      </li>
      <li class="nav-item" role="presentation">
        <button [ngClass]="active == 'register' ? 'nav-link active' : 'nav-link'" id="tab-register"
                (click)="onRegisterTab()" >Regisztráció</button>
      </li>
    </ul>

    <div class="tab-content">
      <div [ngClass]="active == 'login' ? 'tab-pane fade show active' : 'tab-pane fade'">
        <form (ngSubmit)="onSubmitLogin()" #loginForm="ngForm">

          <div class="form-outline mb-4">
            <input type="text" id="loginName" name= "email" class="form-control" [(ngModel)]="email" />
            <label class="form-label" for="loginName">E-mail</label>
          </div>

          <div class="form-outline mb-4">
            <input type="password" id="loginPassword" name="password" class="form-control" [(ngModel)]="password" />
            <label class="form-label" for="loginPassword">Jelszó</label>
          </div>

          <button type="submit" class="btn btn-primary btn-block mb-4">Bejelentkezés</button>

        </form>
      </div>
      <div [ngClass]="active == 'register' ? 'tab-pane fade show active' : 'tab-pane fade'">
        <form (ngSubmit)="onSubmitRegister()" #registerForm="ngForm">

          <div class="form-outline mb-4">
            <input type="text" id="firstName" name="firstName" class="form-control" [(ngModel)]="firstName" />
            <label class="form-label" for="firstName">Vezetéknév</label>
          </div>

          <div class="form-outline mb-4">
            <input type="text" id="lastName" name="lastName" class="form-control" [(ngModel)]="lastName" />
            <label class="form-label" for="lastName">Keresztnév</label>
          </div>

          <div class="form-outline mb-4">
            <input type="text" id="login" name="login" class="form-control" [(ngModel)]="email" />
            <label class="form-label" for="login">E-mail</label>
          </div>

          <div class="form-outline mb-4">
            <input type="password" id="registerPassword" name="password" class="form-control" [(ngModel)]="password" />
            <label class="form-label" for="registerPassword">Jelszó</label>
          </div>

          <div class="form-outline mb-4">
            <input type="number" id="phone" name="phone" class="form-control" [(ngModel)]="phone" />
            <label class="form-label" for="phone">Telefonszám</label>
          </div>

          <div class="form-outline mb-4">
            <input type="text" id="city" name="city" class="form-control" [(ngModel)]="city" />
            <label class="form-label" for="city">Város</label>
          </div>

          <div class="form-outline mb-4">
            <input type="text" id="address" name="address" class="form-control" [(ngModel)]="address" />
            <label class="form-label" for="address">Utca, házszám</label>
          </div>

          <button type="submit" class="btn btn-primary btn-block mb-3">Sign in</button>
        </form>
      </div>
    </div>
  </div>
</div>
